import Vue from "vue";
import VueRouter from "vue-router";
import Home from "../views/MyHome.vue";
import Record from "../views/MyWorkoutRecord";

Vue.use(VueRouter);

const routes = [
  {
    path: "/",
    name: "home",
    component: Home,
  },
  {
    path: "/workout-records", // 追加
    name: "WorkoutRecord",
    component: Record,
  },
];

const router = new VueRouter({
  mode: "history",
  routes,
});

export default router;
